  true,\n\t\"url\": null,\n\t\"notes\": \"Annual average wind resource potential of
  the northwestern United States at a 50 meter height.rnrnThis data set has been validated
  by NREL and wind energy meteorological consultants. *Note*: This data is not suitable
  for micro-siting potential development projects. This shapefile was generated from
  a raster dataset with a 400 m resolution, in a UTM zone 11, datum WGS 84 projection
  system. The resource information for the Confederated Tribes of the Umatilla reservation
  is not being made available as part of this data set at their request.rnrnThe wind
  power resource estimates were produced by TrueWind Solutions using their MesoMap
  system and historical weather data under contract to Wind Powering America/NREL.
  This map has been validated with available surface data by NREL and wind energy
  meteorological consultants.\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
